import React from 'react';
class Prices extends React.Component {
    state = {
        currency : 'USD'
    }

    render() {
        return (
            <div>
                {/* <img src=""> */}
                {this.props.data.children[2].data.url}
                Prices
            </div>
        )
    }
}

export default Prices;
